import React from 'react' ;

function add(a,b){
    let sum = a+b ;
    return sum ;
}

function sub(a,b){
    let sum = a-b ;
    return sum ;
}

function mul(a,b){
    let sum = a*b ;
    return sum ;
}

function divi(a,b){
    let sum = a/b ;
    sum = sum.toFixed(2) ;
    return sum ;
}

export {add, sub, mul , divi } ;
